import React from 'react';
import styled from 'styled-components';


const Tbody = styled.tbody`
.tr {
    border-bottom: 1px solid #dddddd;
}

.tr:nth-of-type(even) {
    background-color: #f3f3f3;
}

.tr:last-of-type {
    border-bottom: 2px solid #009879;
}

.td{
    padding: 12px 15px;
}
`;


const Customer = (props) => {
    return (
        <div>

            <Tbody>
                <tr className="tr">
                    <td className="td">
                        {props.id}
                    </td>
                </tr>
                <tr>
                    <td className="td">
                        {props.name}
                    </td>
                </tr>
                <tr>
                    <td className="td">
                        {props.birthday}
                    </td>
                </tr>
                <tr>
                    <td className="td">
                        {props.gender}
                    </td>
                </tr>
                <tr>
                    <td className="td">
                        {props.job}
                    </td>
                </tr>
            </Tbody>
        </div>
    )
}



export default Customer;
